        [Test, Order(2)]
        public void ECurrencyList()
        {
            var request = _izibizClient.ECurrency().ECurrencyList(Authentication.Token);
            Assert.NotNull(request);
            System.Diagnostics.Debug.WriteLine("E-Döviz Listesi : ");
            foreach (var ecurrency in request.contents)
            {
                System.Diagnostics.Debug.WriteLine("Belge Numarası : " + ecurrency.documentNo + "Belge Tip: " + ecurrency.documentType);
            }
        }

