        [Test, Order(4)]
        public void ECurrency_SendJson()
        {


            var response = _izibizClient.ECurrency().ECurrencySendJson(Authentication.Token);
            byte[] content = FolderOperations.DecompressZip(response.content);
            File.WriteAllBytes(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments) + @"\" + response.filename.Replace(".zip", ".xml").ToString(), content);
        }


        [Test, Order(5)]
