            var req = new ECurrencyCompressUblRequest
            {
                documentAction = "SEND",
                compressed = true,
                //Gönderilmesi gereken ubl dosyasını zipleyerek base64 tipinde content alanına verilmesi gerekmektedir.
                content = ""
            };
            var response = _izibizClient.ECurrency().ECurrencyCompressUBL(Authentication.Token, req);
            Assert.NotNull(response);
            if (response.data == null)
            {
                System.Diagnostics.Debug.WriteLine(response.error.message);
            }
            Assert.NotNull(response.data);
        }

